import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const LoginPage = ({ onLogin }) => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const [isHovered, setIsHovered] = useState(false);
  const navigate = useNavigate();

  const users = [
    { username: "erva.ergul", password: "123456" },
    { username: "busra.inan", password: "123456" },
    { username: "ege.kuzu", password: "123456" },
    { username: "kevser.semiz", password: "123456" },
    { username: "helin.ozalkan", password: "123456" },
    { username: "sumeyye.agir", password: "123456" },
    { username: "efe.kesler", password: "123456" },
    { username: "devran.sahin", password: "123456" },
    { username: "cengizhan.karaman", password: "123456" },
    { username: "enes.coban", password: "123456" },
    { username: "kerem.guney", password: "123456" },
  ];

  const handleLogin = () => {
    if (!username || !password) {
      setError("Lütfen kullanıcı adı ve şifreyi boş bırakmayınız.");
      return;
    }

    const foundUser = users.find(
      (user) => user.username === username && user.password === password
    );

    if (foundUser) {
      setError("");
      onLogin();
      navigate("/");
    } else {
      setError("Kullanıcı adı veya şifre yanlış.");
    }
  };

  return (
    <div style={styles.container}>
      <img
        src="/images/karaciger.png"
        alt="Karaciğer Görseli"
        style={styles.sideImage}
      />

      <div
        style={{
          ...styles.card,
          ...(isHovered ? styles.cardHover : {}),
        }}
        onMouseEnter={() => setIsHovered(true)}
        onMouseLeave={() => setIsHovered(false)}
      >
        <img src="/images/istun_logo.png" alt="Logo" style={styles.logo} />
        <h2 style={styles.title}>Giriş Yap</h2>

        <input
          type="text"
          placeholder="Kullanıcı Adı"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          style={styles.input}
        />
        <input
          type="password"
          placeholder="Şifre"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          style={styles.input}
        />

        {error && <div style={styles.errorText}>{error}</div>}

        <button onClick={handleLogin} style={styles.button}>
          Giriş Yap
        </button>

        <small style={styles.footerText}>© 2025 Fibrozis Tahmin Sistemi</small>
      </div>
    </div>
  );
};

const styles = {
  container: {
    height: "100vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#fff",
    padding: "20px",
  },
  sideImage: {
    width: "300px",
    maxWidth: "90%",
    marginBottom: "30px",
    marginTop: "-30px",
  },
  card: {
    width: "100%",
    maxWidth: "400px",
    background:
      "linear-gradient(145deg, #d0d4d9, #a1a5aa)", // hafif degrade gri tonlarıyla metalik his
    padding: "40px",
    borderRadius: "25px",
    boxShadow:
      "inset 2px 2px 5px rgba(255,255,255,0.8), inset -2px -2px 7px rgba(0,0,0,0.15), 4px 4px 15px rgba(0,0,0,0.2)",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    border: "1px solid rgba(255,255,255,0.4)",
    transition: "transform 0.3s ease, box-shadow 0.3s ease",
    cursor: "default",
  },
  cardHover: {
    transform: "scale(1.05)",
    boxShadow:
      "inset 2px 2px 7px rgba(255,255,255,0.9), inset -2px -2px 9px rgba(0,0,0,0.2), 6px 6px 22px rgba(0,0,0,0.3)",
    cursor: "pointer",
  },
  logo: {
    height: "50px",
    marginBottom: "15px",
  },
  title: {
    marginBottom: "20px",
    color: "#2E7D32",
    fontSize: "24px",
    fontWeight: "700",
  },
  input: {
    width: "100%",
    padding: "10px",
    marginBottom: "15px",
    borderRadius: "8px",
    border: "1px solid #999",
    fontSize: "14px",
    boxShadow:
      "inset 1px 1px 3px rgba(255,255,255,0.8), inset -1px -1px 3px rgba(0,0,0,0.1)",
    transition: "border-color 0.3s ease",
  },
  button: {
    padding: "12px 20px",
    width: "100%",
    backgroundColor: "#2E7D32",
    color: "#fff",
    border: "none",
    borderRadius: "8px",
    fontWeight: "700",
    cursor: "pointer",
    fontSize: "16px",
    marginTop: "10px",
    transition: "background-color 0.3s ease",
  },
  footerText: {
    marginTop: "20px",
    color: "#999",
    fontSize: "12px",
  },
  errorText: {
    color: "red",
    marginBottom: "10px",
    fontWeight: "bold",
    textAlign: "center",
    width: "100%",
  },
};

export default LoginPage;
